link.script:
jQuery(document).ready(function ($) {
			var cssClass = "";
			var clipPathUrl = "svg-shape-1660227478327";
			var shapeEnabled = "0";

			$(document).on("click", "#sppb-addon-1660227478327 .sppb-image-lightbox", function (event) {
				event.preventDefault();
				var $this = $(this);

				function applyStyles(img){
						var figure = $(".mfp-figure");
						var height = img[0].naturalHeight;

						if(shapeEnabled == 1){

						figure.attr("has-shape", "");
						img.css("max-height", height);
						img.css("padding", 0);

						if(cssClass){
							img.addClass(cssClass);
						}

						if (clipPathUrl) {
							img.css("clip-path", "url(#" + clipPathUrl + ")");
						}
					}
				}

				if ($.magnificPopup.instance) {
            		$.magnificPopup.close();
        		}

				if ($this.magnificPopup) {
					$this.magnificPopup({
						type: $this.data("popup_type"),
						mainClass: $this.data("mainclass"),
						callbacks: {
							imageLoadComplete: function () {
									var img = this.currItem.img;
									applyStyles(img);
							}
						}
					}).magnificPopup("open");
				}
			});
		});

function onUserInteract(callback) { 
	window.addEventListener('load', function() {
	        if (window.pageYOffset !== 0){
	        	callback();
	        }
	}, {once: true, passive: true});

     	const events = ['keydown', 'keyup', 'keypress', 'input', 'auxclick', 'click', 'dblclick', 
     	'mousedown', 'mouseup', 'mouseover', 'mousemove', 'mouseout', 'mouseenter', 'mouseleave',
     	'mousewheel', 'wheel', 'contextmenu', 'pointerover', 'pointerout', 'pointerenter', 'pointerleave', 
     	'pointerdown', 'pointerup', 'pointermove', 'pointercancel', 'gotpointercapture',
     	'lostpointercapture', 'pointerrawupdate', 'touchstart', 'touchmove', 'touchend', 'touchcancel'];

	document.addEventListener('DOMContentLoaded', function() {
    	events.forEach(function(e){
			window.addEventListener(e, function() {
	        		callback();
			}, {once: true, passive: true});
    	});
	});
}

let jch_dom_loaded = false;

onUserInteract(function(){
    if(!jch_dom_loaded) {
	    const containers = document.getElementsByClassName('jch-reduced-dom-container');

	    Array.from(containers).forEach(function(container){
       		//First child should be templates with content attribute
		    let template  = container.firstChild; 
		    //clone template
		    let clone = template.content.firstElementChild.cloneNode(true);
		    //replace container with content
		    container.parentNode.replaceChild(clone, container); 
	    })

	    jch_dom_loaded = true;
        document.dispatchEvent(new Event("onJchDomLoaded"));
	}
});
